import React, { FC } from "react";
import { ModuleWrapper } from "../../components/module-wrapper/module-wrapper";
import Masonry from "react-masonry-css";

import './image-overview.scss';

export const ImageOverview: FC = () => {
    return (
      <ModuleWrapper>
          <Masonry
              breakpointCols={2}
              className="my-masonry-grid"
              columnClassName="my-masonry-grid_column">
              <div className="art">
                  <img src="https://placekitten.com/800/800"/>
              </div>
              <div className="art">
                  <img src="https://placekitten.com/800/1200"/>
              </div>
              <div className="art">
                  <img src="https://placekitten.com/1200/800"/>
              </div>
              <div className="art">
                  <img src="https://placekitten.com/800/800"/>
              </div>
          </Masonry>
      </ModuleWrapper>
    );
};
